[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX ddbj: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dc: <http://purl.org/dc/elements/1.1/>

SELECT ?locus_tag ?gene_name ?product
WHERE {
  ?entry dc:identifier "CP036276.1" .
  ?entry ddbj:feature ?feature .
  ?feature ddbj:feature_type "CDS" .
  ?feature ddbj:gene ?gene_name .
  ?feature ddbj:locus_tag ?locus_tag .
  ?feature ddbj:product ?product .
  FILTER(CONTAINS(LCASE(?gene_name), "clpx") || CONTAINS(LCASE(?product), "clpx"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX ddbj: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dc: <http://purl.org/dc/elements/1.1/>

SELECT DISTINCT ?locus_tag ?gene ?product
WHERE {
  ?s dc:identifier "CP036276.1" .
  ?s ?p ?feature .
  ?feature ?q ?locus_tag .
  OPTIONAL { ?feature ?r ?gene }
  OPTIONAL { ?feature ?t ?product }
  FILTER(CONTAINS(STR(?locus_tag), "tag") || CONTAINS(STR(?gene), "clpX") || CONTAINS(STR(?product), "ClpX"))
}
LIMIT 100"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>

SELECT ?locus_tag ?gene_symbol ?product
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:locus_tag ?locus_tag .
  OPTIONAL { ?gene nuc:gene ?gene_symbol }
  OPTIONAL {
    ?cds nuc:locus_tag ?locus_tag ;
         nuc:product ?product .
  }
  FILTER(CONTAINS(STR(?gene), "CP036276.1"))
  FILTER(?gene_symbol = "clpX")
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>

SELECT DISTINCT ?locus_tag ?gene_symbol
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:locus_tag ?locus_tag .
  OPTIONAL { ?gene nuc:gene ?gene_symbol }
  FILTER(CONTAINS(STR(?gene), "CP036276.1"))
  FILTER(CONTAINS(LCASE(STR(?gene_symbol)), "clpx"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>

SELECT ?locus_tag ?gene_symbol ?product
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:locus_tag "Mal52_08030" ;
        nuc:gene ?gene_symbol .
  OPTIONAL {
    ?cds nuc:locus_tag "Mal52_08030" ;
         nuc:product ?product .
  }
  BIND("Mal52_08030" AS ?locus_tag)
}"}}]

