[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT DISTINCT ?disease ?label ?identifier
WHERE {
  ?disease rdfs:label ?label .
  ?disease dcterms:identifier ?identifier .
  FILTER(CONTAINS(LCASE(?label), "parkinson"))
}
ORDER BY ?label"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?nando_id ?label_ja ?label_en
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
    ?Nando a owl:Class ;
        dct:identifier ?nando_id ;
        rdfs:label ?label_ja .
    OPTIONAL {
        ?Nando rdfs:label ?label_en .
        FILTER(lang(?label_en) = "en")
    }
    FILTER(CONTAINS(LCASE(?label_ja), "パーキンソン") || CONTAINS(LCASE(?label_en), "parkinson"))
}
ORDER BY ?nando_id"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pubchem"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
