SELECT (MIN(?weight) as ?min_weight) (MAX(?weight) as ?max_weight) (AVG(?weight) as ?avg_weight) (COUNT(?compound) as ?drug_count)
WHERE {
  ?compound a vocab:Compound ;
            obo:RO_0000087 vocab:FDAApprovedDrugs ;
            sio:SIO_000008 ?weightDesc .
  ?weightDesc a sio:CHEMINF_000334 ;
              sio:SIO_000300 ?weight .
  FILTER(isNumeric(?weight))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT 
  (COUNT(CASE WHEN ?weight < 100 THEN 1 END) as ?under_100)
  (COUNT(CASE WHEN ?weight >= 100 AND ?weight < 200 THEN 1 END) as ?weight_100_200)
  (COUNT(CASE WHEN ?weight >= 200 AND ?weight < 300 THEN 1 END) as ?weight_200_300)
  (COUNT(CASE WHEN ?weight >= 300 AND ?weight < 400 THEN 1 END) as ?weight_300_400)
  (COUNT(CASE WHEN ?weight >= 400 AND ?weight < 500 THEN 1 END) as ?weight_400_500)
  (COUNT(CASE WHEN ?weight >= 500 AND ?weight < 1000 THEN 1 END) as ?weight_500_1000)
  (COUNT(CASE WHEN ?weight >= 1000 THEN 1 END) as ?over_1000)
WHERE {
  ?compound a vocab:Compound ;
            obo:RO_0000087 vocab:FDAApprovedDrugs ;
            sio:SIO_000008 ?weightDesc .
  ?weightDesc a sio:CHEMINF_000334 ;
              sio:SIO_000300 ?weight .
  FILTER(isNumeric(?weight))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
