[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?reaction ?reactionLabel ?equation
WHERE {
  ?reaction a rh:Reaction ;
            rdfs:label ?reactionLabel ;
            rh:equation ?equation .

  # Check that the reaction involves both ATP and ADP
  ?reaction rh:side ?side1 .
  ?side1 rh:contains ?participant1 .
  ?participant1 rh:compound ?compound1 .
  ?compound1 rdfs:label ?label1 .

  ?reaction rh:side ?side2 .
  ?side2 rh:contains ?participant2 .
  ?participant2 rh:compound ?compound2 .
  ?compound2 rdfs:label ?label2 .

  # Filter for reactions containing both ATP and ADP
  FILTER(CONTAINS(LCASE(?label1), "atp") || CONTAINS(LCASE(?label2), "atp"))
  FILTER(CONTAINS(LCASE(?label1), "adp") || CONTAINS(LCASE(?label2), "adp"))
  FILTER(?compound1 != ?compound2)
}
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?reaction ?reactionLabel ?equation
WHERE {
  ?reaction a rh:Reaction ;
            rdfs:label ?reactionLabel ;
            rh:equation ?equation .

  # Look for reactions where the equation contains both ATP and ADP
  FILTER(CONTAINS(?equation, "ATP") && CONTAINS(?equation, "ADP"))
}
LIMIT 50"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?reaction ?equation ?label
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:equation ?equation ;
            rdfs:label ?label ;
            rhea:status rhea:Approved .
  ?equation bif:contains "'ATP' AND 'ADP'" option (score ?sc) .
}
ORDER BY DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?reaction ?equation ?ec ?goTerm
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:equation ?equation ;
            rhea:status rhea:Approved .
  ?equation bif:contains "'ATP' AND 'ADP'" option (score ?sc) .

  OPTIONAL { ?reaction rhea:ec ?ec . }
  OPTIONAL { 
    ?reaction rdfs:seeAlso ?goTerm .
    FILTER(STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_"))
  }
}
ORDER BY DESC(?sc)
LIMIT 30"}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human kinase reviewed", "limit": 50}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
